  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a part of Ecotrust's project
  entitled: Establishing a Baseline and Assessing Spatial and Socioeconomic Change
  in the California Central Coast Commercial and CPFV Fisheries. This project is a
  component of the California Central Coast Marine Protected Area Baseline Monitoring
  Project that is designed to characterize the ecological and socioeconomic conditions
  and changes within the Central Coast Region since MPA implementation. The Central
  Coast study region extends from the north at Pigeon Point to the south at Point
  Conception. This data set consists of data collected in the spring of 2012 from
  fisheries mapping interviews with commercial fishermen who had Nearshore finfish-live--trap
  landings in the California Central Coast in 2011. Results from the interviews were
  then combined through an aggregation process where the value each fisherman gives
  to their Nearshore finfish-live fishing grounds are weighted by their landings for
  Nearshore finfish-live in 2011. This data set represents the spatial extent and
  relative value of Nearshore finfish-live commercial fishing grounds for the Central
  Coast Region in the year 2011.\",\n\t\"owner_org\": \"467d900f-8a42-452d-9906-6610dd1a767f\",\n\t\"extras\":
